import React from "react";
import Slider from "react-slick";
import { Helmet } from "react-helmet";


<Helmet>
				<script src="./assets/js/hovers.js"></script>
				<script src="./assets/js/snap.svg-min.js"></script>
				<link rel="stylesheet" type="text/css" href="./assets/css/slick-theme.css" />
		<link rel="stylesheet" type="text/css" href="./assets/css/slick.css" />
			</Helmet>

function MoCOrganization() {
  
    
      var settings = {
      dots: true,
      infinite: false,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 4,
      initialSlide: 0,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };
    return (
      <div>
        <h2> Responsive </h2>
        <Slider {...settings}>
          <div>
            <img src=""/>
          </div>
          <div>
          <img src=""/>
          </div>
          <div>
          <img src=""/>
          </div>
          <div>
          <img src=""/>
          </div>
          <div>
          <img src=""/>
          </div>
          <div>
          <img src=""/>
          </div>
          <div>
          <img src=""/>
          </div>
          <div>
          <img src=""/>
          </div>
        </Slider>
      </div>
    );
  }

    
  

export default MoCOrganization
